releaseNotes: "## Python SDK Changes:\n* `shippo.batches.create()`: \n  *  `request.batch_shipments[].shipment` **Changed** **Breaking** \n* `shippo.batches.add_shipments()`: \n  *  `request_body[].shipment` **Changed** **Breaking** \n* `shippo.carrier_accounts.list()`: \n  *  `request.carrier` **Changed** **Breaking** \n* `shippo.carrier_accounts.register()`:  `request` **Changed** **Breaking** \n* `shippo.rates_at_checkout.create()`: \n  *  `request.parcel.union(Parcel).template.union(ParcelTemplateCouriersPleaseEnum)` **Removed** **Breaking** \n* `shippo.parcels.list()`:  `response.results[].template.union(ParcelTemplateCouriersPleaseEnum)` **Removed** **Breaking** \n* `shippo.parcels.create()`: \n  *  `request.union(ParcelCreateFromTemplateRequest).template.union(ParcelTemplateCouriersPleaseEnum)` **Removed** **Breaking** \n  *  `response.template.union(ParcelTemplateCouriersPleaseEnum)` **Removed** **Breaking** \n* `shippo.parcels.get()`:  `response.template.union(ParcelTemplateCouriersPleaseEnum)` **Removed** **Breaking** \n* `shippo.shipments.list()`:  `response.results[]` **Changed** **Breaking** \n* `shippo.shipments.create()`: \n  *  `request` **Changed** **Breaking** \n  *  `response` **Changed** **Breaking** \n* `shippo.shipments.get()`:  `response` **Changed** **Breaking** \n* `shippo.transactions.create()`: \n  *  `request.union(InstantTransactionCreateRequest).shipment` **Changed** **Breaking** \n"
